var nginxtype_meta_texts = [{
  "value": "no-cache",
  "paraId": 0
}, {
  "value": "我测试单独配置 ",
  "paraId": 1,
  "tocIndex": 0
}, {
  "value": "no-cache",
  "paraId": 1,
  "tocIndex": 0
}, {
  "value": " 不生效, nginx 好像有一个默认的过期时间, 如果没过期就不会向服务器请求, 需要配置",
  "paraId": 1,
  "tocIndex": 0
}, {
  "value": "expires 0",
  "paraId": 1,
  "tocIndex": 0
}, {
  "value": "; 浏览器就会认为这里的每个文件都过期了, 快点去跟服务器请求一下, 然后根据服务器的 ETag 验证有哪些文件更新了, 就从服务器下载最新的并且响应码为",
  "paraId": 1,
  "tocIndex": 0
}, {
  "value": "200",
  "paraId": 1,
  "tocIndex": 0
}, {
  "value": ", 如果文件没有更新则响应码为",
  "paraId": 1,
  "tocIndex": 0
}, {
  "value": "304",
  "paraId": 1,
  "tocIndex": 0
}, {
  "value": "告诉浏览器目前的缓存也是有效的你直接用就行。",
  "paraId": 1,
  "tocIndex": 0
}, {
  "value": "no-store",
  "paraId": 0
}, {
  "value": "所有的文件都从服务器上下载, 保持最新的(不常用)",
  "paraId": 2,
  "tocIndex": 1
}, {
  "value": "# add_header Cache-Control\n# public 所有内容都将被缓存（客户端和代理服务器都可缓存）\n# private 内容只缓存到私有缓存中（仅客户端可以缓存，代理服务器不可缓存）。\n# no-cache 必须先与服务器确认返回的响应是否被更改，然后才能使用该响应来满足后续对同一个网址的请求。因此，如果存在合适的验证停牌（ETag），no-cache 会发起往返通信来验证缓存的响应，如果资源未被更改，可以避免下载。\n# no-store 所有内容都不会被缓存到缓存或 Internet 临时文件中，强制缓存和对比缓存都不会触发。\n# must-revalidation.proxy-revalidation 如果缓存内容失败，请求必须发送到服务器、代理以进行重新验证。\n# max-age=xxx(xxx is numeric） 缓存的内容将在 xxx 秒失效，这个选项只在 HTTP 1.1 可用，并如果和 Last-Modified 一起使用时，优先级较高。\n\n # 代理websocket需要用到的配置\n map $http_upgrade $connection_upgrade {\n        default upgrade;\n        '' close;\n }\n\nserver {\n        listen 3300;\n        server_name localhost;\n        location ^~/alert/ {\n            proxy_pass http://www.baidu.com/;\n            client_max_body_size 10m; #允许客户端请求的最大单文件字节\n        }\n\n        location / {\n            root  /program/client-alert/app/;\n            # 这里的缓存\n            if ($request_filename ~* ^.*?.(html|htm|js|css|json)$) {\n                add_header Cache-Control \"no-cache\";\n                expires 0;\n            }\n        }\n         # 上方的 map + 下方的配置 websocket\n        location ^~/wsnginx/ {\n            proxy_pass http://www.baidu.com/ws;\n            proxy_http_version 1.1;\n            proxy_set_header Upgrade $http_upgrade;\n            proxy_set_header Connection \"upgrade\";\n        }\n\n\n        # 高德地图地点搜索服务   xxxxx 是你申请的服务key\n        location /_AMapService/ {\n            set $args \"$args&key=xxxxx\";\n            proxy_pass https://restapi.amap.com/;\n        }\n    }\n\n\n\n",
  "paraId": 3,
  "tocIndex": 1
}];
