  "value": "有时候觉得陈思萌说话很孩子气，就如现在，哪有组团去拜佛的！不过当知道她的男朋友还是空缺的时候，心里还是开心了下。\n“我明天上午租单车去，你要是去的话，是从学校还是家里出发？”\n“我回学校吧，跟你一起去上香！”\n骑着单车绕着西湖，然后再去灵隐寺，没想到明天边上还有她的陪伴！",
