  "value": "【也许写完这篇文章后，你们会慢慢淡忘这个故事\n也许写完这篇文章后，我会一个人独自面对生活走下去\n也许，以后过的好的时候，过的不好的时候，都是一个人\n在这里，我祝愿自己曾经爱过的的，或者是爱过自己的，都能找到自己的幸福。\n我叫何溢华，我在以南以南的城市拖着病体写结局】",
