  "lastUpdated": 1683537368000,
  "description": "之前我以为 xray-core 必须配合客户端一起配合才能使用, 所以我一直使用的是 mac 下 V2RayXS, 偶然间发现有人提出了一个issues, 关于如何修改inbound配置, 详细了解之后发现这个功能确实挺好用的,可以直接拦截一些广告请求, 在客户端翻了一遍没找到 config.json 所处的位置, 然后在 xray-core 文件夹翻来覆去, 碰巧看到一篇文章在 PC 端手工配置 xray-core\n这篇文章大概意思就是教你在脱离 GUI 的情况之下如何使用 xray 然后恍然大悟, xray-core 丢在 vps 上就是服务端, 丢在本机就是客户端\n所谓的 GUI 程序本质上就是把本机的请求筛选后, 也可能没有筛选这一步, 直接转发到 xray 所在的端口然后经过配置路由进行分发, 　我用的 V2RayXS 是有一个 PAC 文件, 只有在 PAC 中的域名才会被代理否则直链;"
