var nfctype_meta_texts = [{
  "value": "最近要用微信小程序的 NFC 读写功能和支持 NFC 协议的卡片通讯, ",
  "paraId": 0,
  "tocIndex": 1
}, {
  "value": "参见",
  "paraId": 0,
  "tocIndex": 1
}, {
  "value": "通讯协议",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": ": ",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": "参见",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": "验密",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": ": 根据卡片中存储的 keyA 或 keyB 进行验证, 验证通过后才能操作读写, 每次读写都需要验证密钥\n",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": "NFC卡片",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": ": 我这边使用的是 MifareClassic, 这张卡片每次读写都需要",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": "验密",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": ", 有些其他的卡是不用",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": "验密",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": ",操作都是类似, 免密卡更简单\n",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": "小程序版本",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": ": 基础库 2.11.2 开始支持，仅支持 Android 平台, ios 不支持",
  "paraId": 1,
  "tocIndex": 1
}, {
  "value": "标准 NFC 操作: 存在",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "扇区",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "和",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "块",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": " 的概念, 我的这张卡有",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "16个扇区",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": ", 每个扇区下有",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "4个块",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": ", 扇区从",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "1开始",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": ", 块从",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "0开始",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": ",\n小程序操作: 小程序抹去了扇区的概念, 统一使用",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "块",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "进行操作, 16 个扇区也就是共有 ",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "16*4 = 64块",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": ", 下标从",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "0块 ~ 63块",
  "paraId": 2,
  "tocIndex": 2
}, {
  "value": "注意!!!",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": " 根据协议 每个扇区的",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "尾块",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "记录的是密钥, ",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "[0~5]=keyA",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": ", ",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "[6~9]=访问控制",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": ", ",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": " [11~15]=keyB",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "\n比如 ",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "1扇区3块",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "就是",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "尾块",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "(小程序的 3 块), ",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "2扇区3块",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "也是",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "尾块",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "(小程序的 7 块) 由此可以得知每个扇区都可以单独加密\n",
  "paraId": 3,
  "tocIndex": 2
}, {
  "value": "1 扇区 0 块 这里记录的是厂商信息,已经固化无法覆写, 只能读取",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": "1 扇区 3 块 ",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": "尾块",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": " 每个扇区的第 3 块(下标从 0 开始),这里记录的是密钥信息, 就是根据这里的数据进行验密\n小程序的对应的就是 3,7,11 .....63 作为 ",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": "尾块",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": "特别要注意这个尾块, 我就是不小心覆写了这个块导致我现有两块扇区都变成了死扇区, 密钥也忘记了是多少 ",
  "paraId": 4,
  "tocIndex": 2
}, {
  "value": "0x60",
  "paraId": 5,
  "tocIndex": 3
}, {
  "value": " 验密",
  "paraId": 5,
  "tocIndex": 3
}, {
  "value": "0x30",
  "paraId": 5,
  "tocIndex": 3
}, {
  "value": " 读取数据",
  "paraId": 5,
  "tocIndex": 3
}, {
  "value": "0xA0",
  "paraId": 5,
  "tocIndex": 3
}, {
  "value": " 写入数据",
  "paraId": 5,
  "tocIndex": 3
}, {
  "value": "统一格式: ",
  "paraId": 6,
  "tocIndex": 3
}, {
  "value": "[指令 1字节]",
  "paraId": 6,
  "tocIndex": 3
}, {
  "value": "+",
  "paraId": 6,
  "tocIndex": 3
}, {
  "value": "[块号 1字节]",
  "paraId": 6,
  "tocIndex": 3
}, {
  "value": "+",
  "paraId": 6,
  "tocIndex": 3
}, {
  "value": "[内容16字节]",
  "paraId": 6,
  "tocIndex": 3
}, {
  "value": "// 验密指令 0x60\n// 每个块的验密要根据块号来  比如你要读写1块 那么验密的块号就是1块 不能验密1块读写7块, 7块要使用7块的验密\nconst decryCmd = [];\ndecryCmd[0]:指令 0x60\ndecryCmd[1]:块号 0x01 对应 10进制的 1 就是1块, 如果要读取63块就是 0x3f\ndecryCmd[2~17]:内容 填充密钥信息, 一般卡片刚出场是默认是 6个`0xFF` 所以解密指令length = 8\n\n// 读取指令 0x30\nconst readCmd = [];\nreadCmd[0]:指令 0x30\nreadCmd[1]:块号 0x01 对应 10进制的 1 就是1块, 如果要读取63块就是 0x3f\nreadCmd[2~17]:内容 按照协议标准的[2~3]是CRC 也就是`效验和`  读取的时候没有要求 可以填充0xff\n\n\n// 写入指令 0xA0\nconst writeCmd = [];\nwriteCmd[0]:指令 0xA0\nwriteCmd[1]:块号 0x01 对应 10进制的 1 就是1块, 如果要读取63块就是 0x3f\nwriteCmd[2~17]:内容 按照协议标准的[2~3]是CRC 也就是`效验和` 根据内容写入数据, 不足的可以填充0xff或0x00看你自己的喜好\n\n写入成功后建议再读取一次,比较一些写入数据和读取的数据, 验证是否真的写入成功\n\n",
  "paraId": 7,
  "tocIndex": 3
}, {
  "value": "使用 wx.getNFCAdapter() 获取 NFC 适配器 ",
  "paraId": 8,
  "tocIndex": 4
}, {
  "value": " const NFCAdapter = wx.getNFCAdapter()",
  "paraId": 8,
  "tocIndex": 4
}, {
  "value": "根据卡片类型调用对应的实例,所以对应的是 ",
  "paraId": 8,
  "tocIndex": 4
}, {
  "value": "NFCAdapter.getMifareClassic()",
  "paraId": 8,
  "tocIndex": 4
}, {
  "value": " 获取 MifareClassic 实例，这个时候需要处理错误, 检查 NFC 功能是否开启, 是否允许访问 NFC 等等",
  "paraId": 8,
  "tocIndex": 4
}, {
  "value": "读取操作: 验密=>读取",
  "paraId": 8,
  "tocIndex": 4
}, {
  "value": "读取操作: 验密=>写入",
  "paraId": 8,
  "tocIndex": 4
}, {
  "value": "读取操作: 验密=>写入=>读取 这种仅需要验密一次,亲测可行",
  "paraId": 8,
  "tocIndex": 4
}, {
  "value": "锁死了两个扇区 8 个块, 这个卡变得不完美了",
  "paraId": 9,
  "tocIndex": 5
}, {
  "value": "一定要先读协议再去操作, 关于这方面的文档太少了, 对于初次接触的时候还是有隐患在里面, 一直验密失败我还以为我代码写的有问题, 找了很多资料才知道把密钥给覆写了, 垃圾微信, 文档上多写一句感觉要死了一样!",
  "paraId": 10,
  "tocIndex": 6
}];
